import React from 'react';
import vid from '../../my-project/src/Vid/lv_0_20230402134428_1.mp4'

const About = () => {
    return (
        <div>
            <div className='vid1'>
                <video src={vid} className='vid py-md-5' autoPlay loop muted playsInline />
                <div className='content'>
<h2>
    Welcome to Salz Pod
</h2>
                </div>

            </div>
        </div>
    );
}

export default About;
